meta.script:
requirejs(['jquery'], function($) {
	$(function () {
		var $window = $(window);
		var offset = $('#header').height();
		var $panel = $('#serviceNavPanel');
		var $anchor = $('.js-nav-anchor');
		var position = 'absolute';
		var hiddenBefore = $anchor.length ? $anchor.offset().top + $anchor.outerHeight() : 0;

		function toggle(scrollTop){
			var hide = scrollTop < hiddenBefore;
			$panel.toggleClass('hide', hide);
			$(window).trigger('panel-visible', !hide);
		}

		function update(){
			var scrollTop = $window.scrollTop();
			toggle(scrollTop);

			var pos = (scrollTop > offset ? 'fixed' : '');
			if (position == pos) return;
			position = pos;

			var css = { position: position };
			css.top = (position == 'fixed' ? 0 : '');

			$panel.css(css);
			var dark = scrollTop > offset;
			$panel.toggleClass('service-top-panel-dark darken', dark);
		}

		$window.on('scroll', {passive: true}, window.rafThrottle(update));
		update();
	});
});

requirejs(['jquery'], function($) {
	$(function () {
		var nav = document.querySelector('.js-service-nav');
		var links = nav.querySelectorAll('.js-toggle-content[data-id]');
		var indicator = nav.querySelector('.js-service-nav-indicator');

		// возможна ситуация, когда в AnchorPanel не будет элементов для скролла
		if (links.length === 0) return;

		var containers = Array.prototype.map.call(links, function (link) {
			return document.getElementById(link.dataset.id)
		});

		containers = containers.filter(Boolean);

		// --- тк на странице в другом порядке по оффсету
		containers.sort(function (container) {
			return container.offsetTop;
		});

		$('#serviceNavPanel').on('click', '.js-nav-item', function () {
			window.za({
				ev_category: 'nav_panel',
				ev_action: 'click',
				ev_label: $(this).data('content-name') || $(this).data('id'),
				object_type: 'organization',
				object_id: '6092d23ac95f9d138e1c8dbd.992f'
			});
		});

		function updateIndicator(link) {
			let navHeight = 25;

								indicator.style.width = link.parentElement.offsetWidth + 'px';
				indicator.style.left = (!$(link).hasClass('.js-toggle-info') && link.getBoundingClientRect().top > navHeight)
					? '-100%'
					: link.parentElement.offsetLeft + 'px';

			link.parentElement.classList.add('active');
			if (link.parentElement.previousElementSibling) link.parentElement.previousElementSibling.classList.add('prev');
			return true
		}

		function handleScroll() {
			// если попали в офсет от 0 до первого контейнера
			// функция не отработает для первого элемента списка ссылок
			// поэтому решаем через флаг updated
			var updated = false;
			var pageYOffset = window.pageYOffset;

			// --- получаем первый видимый на странице
			var visibleContainer = containers.find(function (container) {
				var rect = container.getBoundingClientRect();
				// 100 - header offset
				return (rect.top + rect.height - 100) > 0
			});

			function handleUpdate(container) {
				// remove old active class from li

				var prevActiveLi = nav.querySelector('li.active');
				var prevElement = nav.querySelector('li.prev');
				if (prevActiveLi) {
					prevActiveLi.classList.remove('active');
				}
				if (prevElement) {
					prevElement.classList.remove('prev');
				}

				var containerId = container.id;
				var desiredLink = Array.prototype.find.call(links, function (link) {
					return (link.dataset.id === containerId)
				});

				updated = updateIndicator(desiredLink);
			}

			if (visibleContainer) {
				handleUpdate(visibleContainer);
			} else {
				containers.forEach(function (container) {
					var offsetTop = container.offsetTop;
					if (offsetTop > pageYOffset) {
						return
					}
					handleUpdate(container);
				})
			}

			if (!updated) {
				updateIndicator(links[0]);
			}
		}

		window.addEventListener('scroll', window.rafThrottle(handleScroll), {passive: true});
		handleScroll();
	});
});

