				{},	me.za_params.data,
				{
					ev_category: 'photo',
					object_type: 'offer',
					ev_action: 'slide',
					ev_sourceType: images[current].source,
					ev_sourceId: images[current].source_id
				}
			));

		});
	/*Кейс для фотогалерий орги */
	} else if (me.owner_type === 'org') {
		$controls.on('click', function(e){
			e.preventDefault();
			if (slideEvent) return;
			slideEvent = true;
			if (!me.orgId || !me.source) {
				return;
			}
			var data = {
				ev_category: 'photo',
				object_type: 'organization',
				ev_action: 'slide',
				ev_sourceType: me.source,
				ev_sourceId: me.orgId
			};
			window.za(data);
		})
	}

	function getIndex(index) {
		var index = index !== undefined ? index : current;
		index = (index + images.length) % images.length;

		return index;
	}

	function setSign() {
		var total = me.total || images.length;
		var title = '';
		var signature = '';

		if(total > 1) {
			signature = current+1 + ' / ' + total
		}

		if(images[current].title) {
			title = images[current].title;

			if(total > 1) {
				title += ' — ' + signature
			}

			signature = title;
		}

		$sign.text(signature);
	}

	function setCopyright() {
		$copyright.html(images[current].copyright || '');
	}

	function onShowImage () {
		var $advItems = $list.eq(current).find('.js-gallery-advertisement-item');
		if (!$advItems.length) return;
		$advItems.each(function(){
			var dataZa = $(this).data('za');
			if (!$(this).width() || !$(this).height()) return;
			window.za($.extend({}, dataZa.data, { ev_action: 'show' }));
		});
	}

	function setImage(index) {
		if(!ready) return;
		ready = false;

		var prev = current;
		current = getIndex(index);

		if(prev != current) {
			$list.eq(prev).css('visibility', 'hidden');
		}

		loadImage(current, function(){
			setSign();
			setCopyright();

			if(images.length == 1) {
				me.setPosition();
				return;
			}

			if (current+1 == images.length && me.loadMore) {
				var request = me.loadMore();
				if (request != last_request) {
					last_request = request;
					request.done(function(photos) {
						if (photos.length) {
							appendItems(photos.length);
							images.concat(photos);
							setSign();
						}
					});
				}
			}

			$node.css('min-height', images[current].height);
			$list.hide();
			$list.eq(prev).css('visibility', 'visible');
			$list.eq(current).fadeIn(function(){
				ready = true;
				me.setPosition();
			});
			onShowImage();
			me.setPosition();
			loadImage(current + 1);
		});
	}

	function isImageLoaded(index) {
		var index = getIndex(index);
		var image = $('img', $list.eq(index));

		return image.length;
	}

	function isPromoLoaded(index) {
		var index = getIndex(index);
		var advCard = $('.gallery-advertisement-slide', $list.eq(index));

		return advCard.length;
	}

	function getPromoSlide(index) {
		return index === 1 ? advSecondSlide : advLastSlide;
	}

	function isLeftSlideVisible(index) {
		return index > 0 && index < images.length;
	}

	function isLargeAdv() {
		return me.promoSlides === 'large_adv';
	}

	function setLargeSlideHeight($image, index) {

		if (index !== LARGE_SLIDE_INDEX) {
			return ;
		}

		var prevImageIndex = LARGE_SLIDE_INDEX - 1;
		var isPrevImgLoaded = images[prevImageIndex].loaded;

		if (isLargeAdv() && isPrevImgLoaded) {
			var slideHeight = images[prevImageIndex].height;
			$image.find('.big-slide').css('max-height', slideHeight);
			$image.css('max-height', slideHeight);
		}
	}

	function loadImage(index, cb) {
		var index = getIndex(index);
		var loaded = isImageLoaded(index) || isPromoLoaded(index);

		if (loaded) {
			cb && cb(index);
			return;
		}

		if(!images[current].loaded) {
			$loader.removeClass('hide');
		}

		var $image;
		if(images[index].src) {
			$image = $('', {
				'src': images[index].src,
				'data-source': images[index].source,
				'class': 'get-out'
			}).css('max-height', $(window).height()).appendTo('body');
		} else {
			// Если картинка - промослайд
			var promoSlide = getPromoSlide(index);
			var slideHeight = $(window).height();

			$image = $(promoSlide, {
				'class': 'get-out'
			}).css('max-height', slideHeight).appendTo('body');

			setLargeSlideHeight($image, index);

			onImageLoad(loaded);
		}

		$image.one('load', function () {
			onImageLoad(isImageLoaded(index));
		});

		$image.one('error', function (e) {
			$image.trigger('load');
		});

		if (($.browser && $.browser.msie && $.browser.version < 9) && ($image.length>0) && ($image[0].complete || $image[0].naturalWidth > 0)) { // if image already loaded in ie 7-8
			$image.trigger('load'); // trigger event manually
		}

		function onImageLoad(isLoad) {
			images[index].height = $image.height();
			images[index].loaded = true;

			if(!isLoad) {
				$list.eq(index).append($image.removeClass('get-out'));
			} else {
				$image.remove();
			}

			if (withAdvLeftSide && isLeftSlideVisible(index) && !isPromoLoaded(index) && images[index].height > 200) {
				$list.eq(index).append(advSecondSlide);
				$list.eq(index).wrapInner('<div class="gallery-advertisement-right-slide__wrapper"');

				hideRightSlideItems();
			}

			function hideRightSlideItems() {
				var $items = $list.eq(index).find('.right-slide-item');

				if ($items.length < 2) return;

				if (images[index].height < 600) {
					$items.last().hide();
				}

				if (images[index].height < 400 && $items.length === 3) {
					$items.first().hide();
				}
			}

			$loader.addClass('hide');

			cb && cb(index);
		}
	}

	function appendItems(num) {
		var num = num || 0;
		var l = images.length;
		var i;

		var $tmp = $('');

		for(i = 0; i < l; i++) {
			var $clone = $tpl.clone();
			$tmp.append($clone);
		}

		if(!num) {
			$container.empty();
		}

		$container.append($tmp.html());
		$list = $('li', $container);
		imageMaxHeight();
		setImage(current);
	}

	function imageMaxHeight() {
		$('img', $list).css('max-height', $(window).height());
	}

	function getPromoSlides(callback) {
		if (LayerClass.cache[me.getCacheKey() + 'promoSlides']) {
			callback && callback(LayerClass.cache[me.getCacheKey() + 'promoSlides']);
			return;
		}

		$.ajax({
			url: '/js.php',
			method: 'GET',
			dataType: 'json',
			cache: true,
			data: {
				area: 'organization',
				action: 'GalleryPromoSlides',
				id: me.orgId,
				withBanner: withAdvLeftSide ? 1 : 0,
				blur: me.promoSlides === 'banner_adv_blur' ? 1 : 0,
			},
			success: function(res) {
				if (!res.success) {
					callback && callback();
					return;
				}
				LayerClass.cache[me.getCacheKey() + 'promoSlides'] = res.slides;
				callback && callback(res.slides);
			}
		});
	}

	function addPromoSlides (slides) {
		advLastSlide = '
' + slides.last + '';
		advSecondSlide = '
' + slides.second + '';

		// MAIN-14817 пушим в массив пустые картинки для отрисовки рекламных слайдов.
		images.push({src: '', source: '', loaded: true});
		if(!withAdvLeftSide) {
			images.splice(1, 0, {src: '', source: '', loaded: false});
		}
	}

	function init() {
		if(!images.length) {
			me.close();
			return;
		}

		if(images.length > 1) $controls.show();
		$prev.on('click', function(e) {
			e.preventDefault();
			setImage(current-1);
			changeSignVisibility();
		});

		$next.on('click', function(e) {
			e.preventDefault();
			setImage(current+1);
			changeSignVisibility();
		});

		function changeSignVisibility() {
			if(current === LARGE_SLIDE_INDEX && isLargeAdv() || current === images.length - 1 && advLastSlide) {
				$sign.addClass('hidden');
			} else {
				$sign.removeClass('hidden');
			}
		}

		$(function() {
			$layer.focus();
		});

		$layer.on('keydown', function(event) {
			event.stopPropagation();
		});

		$(window).on('keyup.hotkey', function(e){
			var key = parseInt(e.keyCode || e.which, 10);

			switch(key) {
				case 37:
					$prev.trigger('click');
					break;

				case 39:
					$next.trigger('click');
					break;
			}
		});

		$(window).on('resize.photoview', imageMaxHeight);

		withAdvLeftSide = ['banner_adv', 'banner_adv_blur'].includes(me.promoSlides) ;
		if (isLargeAdv() || withAdvLeftSide) {
			getPromoSlides(function(slides) {
				if (slides) addPromoSlides(slides);
				appendItems();
			});
		} else {
			appendItems();
		}
	}

	me.afterClose = function(){
		$(window).off('keyup.hotkey');
		$(window).off('resize.photoview');
	};

	me.afterShow = function() {
		$node.closest('.layer-container').css({
			left: 0,
			right: 0
		});
		me.setPosition();

		callbacks.afterShow();
	};

	requirejs(['js2/jquery.browser'], function(){
		init();
	});
})(LayerClass.findLast());
